// Function to pick all rows that fulfill the criteria set out by the three dropdown boxes above
function filterImagesByCriteria(query, array) {
  const occupation = query[2];
  const gender = query[0];
  const ai = query[1];

  return array.filter(item => {
    const occupationMatch = (occupation === 'all') || (item.imgCareer === occupation);
    const aiMatch         = (ai === 'all')         || (item.AI === ai);
    const genderMatch     = (gender === 'all')     || (item.imgGender === gender);
    return occupationMatch && aiMatch && genderMatch;
  });
}

